      lottie.loadAnimation({
        container: ans.current,
        renderer: 'svg',
        loop: true,
        autoplay: true,
        animationData: require('/Users/luka/webgifaby/src/img/PRODUCT/Animation 02/drawkit-grape-animation-2-LOOP.json')
      })
    }, [])


    return (
        <div>
            <div className='ans' ref={ans} ></div>
            <Reg />
        </div>
    )
}
